import './App.css';
function Header() {
  return (
    <header>
      <h1><a href="/">web</a></h1>
    </header>
  )
}
function Nav() {
  return (
    <nav>
      <ol>
        <li><a href="/read/1"></a>html</li>
        <li><a href="/read/2"></a>css</li>
        <li><a href="/read/3"></a>js</li>
      </ol>
    </nav>
  )
}
function Article() {
  return (
    <article>
      <h2>Welcome</h2>
      Hello,web
    </article>
  )
}

function App() {
  const name = 'react'
  const style = {
    color : 'red',
    backgroundColor : 'green'
  }
  return (
    <div className="App">
      Hello, Wordl!
      <Header />
      <Nav />{name}
      <Article />
      <div style={style}>
        {name}
      </div>
    </div>
  );
}

export default App;
